import React,{useState} from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import'../login/login.css'
const AddItem =()  =>{
    const navigate = useNavigate()
    const [product,setProduct] = useState('')
    const [quantety,setQuantety] = useState('')
    const [value,setValue] = useState('')

    const product_change_handler =(event)=>{ setProduct(event.target.value)}
    const quantety_change_handler =(event)=>{ setQuantety(event.target.value)}
    const value_change_handler =(event)=>{ setValue(event.target.value)}

    const accessToken = localStorage.getItem('accessToken');
    const handleSubmit = async (event) =>{
        const data = {
            product: product,
            value: quantety,
            quantity: value
        };
        const config = {
            headers: {
                'Authorization': `Bearer ${accessToken}`
            }
        };
        event.preventDefault()
        try{
            const request = await axios.post('http://localhost:3000/agents/add_item',data, config)
            console.log(request)

        }catch(error){
            console.log(error)
        }

    }

    return(
        <div>
            <div></div>
            <div>
                <div className="card">
                    <h1 className="card-header">Add item</h1>
                    <form onSubmit={handleSubmit} > 
                    <div className="card-content">
                        <label>Nome</label>
                        <input type="text" value={product} onChange={product_change_handler}></input>
                    </div>

                    <div className="card-content">
                        <label>Valor</label>
                        <input type="number" value={value} onChange={value_change_handler}></input>
                    </div>

                    <div className="card-content">
                        <label>Quantidade</label>
                        <input type="number" value={quantety} onChange={quantety_change_handler}></input>
                    </div>

                    <div className="card-footer">
                        <button  type="submit">Add</button>
                    </div>
                </form>
        </div>
            </div>
        </div>
    )
}

export default AddItem
